import { createTheme } from '@mui/material';

export const theme = createTheme({
    palette: {
        primary: {
            main: '#87837A',
        },
        secondary: {
            main: '#444540',
        }
    },
});

// 1 #F7F5E9
// 2 #9AB3B4
// 3 #87837A
// 4 #444540
// 5 #000000
